import { join } from 'path-browserify'
import { generateMetadata } from './utils/generateMetadata'

import { getVideoMetadata } from './getVideoMetadata'

// Mocks
const { execFileReturnObjectFixture } = require('./__fixtures__/ffmpeg-return-object-fixture')
jest.mock('./utils/generateMetadata')
const mockGenerateMetadata = generateMetadata as jest.Mock

const fixtureUrl = join(__dirname, '__fixtures__')

describe('generateImageDiory', () => {
  beforeEach(() => {
    mockGenerateMetadata.mockResolvedValue({
      tmpPath: join(fixtureUrl, 'some-video-thumbnail.jpg'),
      metadataString: execFileReturnObjectFixture.stderr,
    })

    jest.spyOn(Math, 'random').mockReturnValue(0)

    process.env.FFMPEG_PATH = 'some-path'
  })

  afterAll(() => {
    delete process.env.FFMPEG_PATH
  })

  it('generates video diory from mp4', async () => {
    const videoMetadata = await getVideoMetadata(join(fixtureUrl, '/some-video.mp4'))

    expect(videoMetadata).toMatchInlineSnapshot(`
      {
        "created": "2020-06-30T08:18:22.000000Z",
        "duration": "00:00:34.56",
        "latlng": "65.4752, 27.9785",
        "name": "",
        "thumbnail": "data:image/jpeg;base64,",
      }
    `)
  })
})
